#Ασεπιτες2008 #Ασεπιτες_2008_θελουμε_δικαιωση 
@nkerameus @ZettaMakri @kmitsotakis

Η κ. #Γκαγκα: «Θα πρέπει σε λίγο να διαλέξουμε αν θα νοσηλευθεί ασθενής με κορονοϊό ή με εγκεφαλικό».

Ο κ. #Σκερτσος: «Δεν υπάρχει και λόγος να δημιουργήσουμε ένα πολυτελές σύστημα υγείας».

Είναι πράγματι η κυβέρνηση έτοιμη να τελέσει ανθρωποκτονία δια παραλείψεως κατά συρροή;

Από τι πέθανε ο Αλ Καπόνε;

Από γκανγκστεντερίτιδα.

#συγνώμη 😑😖🥶

Έρχεται η άλλη να κάτσει να πιει καφέ: ένα εσπρεσακι μου λέει. Ναι της λέω, είναι εύκολο να έχω κάποιο έγγραφο για τον Covid;
Ακόμα κ για το εσπρεσακι ρε παιδιά μου λέει;
Ναι, δεν το ξέραμε να ζητάμε χαρτιά μόνο σε όσους πίνουν καπουτσίνο ας πούμε.

Τελικά το τανκ που πάτησε το ΙΧ ήταν ουκρανικό. Και στο Φιδονήσι παραδόθηκαν. Και η πολυκατοικία χτυπήθηκε από Ουκρανούς.
Μλκ πόσο δράκο τρώμε σ' αυτόν τον πόλεμο; 
#Ουκρανια #πολεμος

Σε μια κίνηση που σίγουρα δεν βοηθά στην εξομάλυνση του τεταμένου κλίματος που επικρατεί στις ελληνοτουρκικές σχέσεις προχώρησε ο πρόεδρος του TDP (Τουρκικό Kόμμα Αλλαγής).OYSA SADECE BARIS ISTEMEK ICIN GELDIK.
